import { CustomDownloader } from '../../downloaders/custom.js';
import { createBaseCollectionsListImporter } from './base.js';
/**
 * Create importer for hardcoded list of icon sets
 */
export function createHardcodedCollectionsListImporter(prefixes, createIconSetImporter) {
    const obj = createBaseCollectionsListImporter(new CustomDownloader(), createIconSetImporter);
    // Add methods that aren't defined in custom downloader
    obj._init = async () => {
        return prefixes.length > 0;
    };
    obj._checkForUpdate = (done) => {
        done(false);
    };
    obj._loadCollectionsList = async () => {
        return prefixes;
    };
    return obj;
}
